    // Wrapping in nv.addGraph allows for '0 timeout render', stores rendered charts in nv.graphs, and may do more in the future... it's NOT required
    var chart;

    nv.addGraph(function() {
        chart = nv.models.lineChart()
            .options({
                transitionDuration: 300,
                useInteractiveGuideline: false
            })
        ;

//setChartViewBox();
// resizeChart();

// These resizes both do the same thing, and require recalculating the chart
//nv.utils.windowResize(chart.update);
//nv.utils.windowResize(function() { d3.select('#fx svg').call(chart) });
// nv.utils.windowResize(resizeChart);
        // chart sub-models (ie. xAxis, yAxis, etc) when accessed directly, return themselves, not the parent chart, so need to chain separately
        var data=DATAPREP();

var dd1= Math.round(xdate.length/2);
var dd3= Math.round(xdate.length*0.97);
var dd2= Math.round(xdate.length*0.1);

chart.xAxis
        .axisLabel('Day')
        .showMaxMin(false)
        .tickValues([xdate[dd1],xdate[dd3],xdate[dd2]])
        .tickFormat(function(d) { return d3.time.format("%Y-%m-%d")(new Date(1000*d)); });

 chart.showLegend(false);

        chart.yAxis
            .axisLabel(' Wealth Accumulation Rate')
            .tickFormat(d3.format(',.2f'))
        ;


        d3.select('#chart1').append('svg')
            .datum(data)
            .call(chart);

        nv.utils.windowResize(chart.update);

        return chart;
    });




    function DATAPREP() {

        var letters = '0123456789abcdef'.split('');
    

         var data = [];
         var keys = Object.keys(datax);
        for (var i = 0; i < keys.length; i++) 
        {
            var color = '#';
            for (var ix = 0; ix < 6; ix++ ) 
            {
            color += letters[Math.floor(Math.random() * 16)];
            }
        
           data.push({key:keys[i],values:[],area: false,color : ""});
           var val = datax[keys[i]];
           data.color=color;
            for (var i1 = 0; i1 < val.length; i1++) 
        {
            var ix=i1;
            data[i].values.push({x: xdate[ix],y:val[i1]}); 
        }
        }
        data[keys.length-1].color='#7777ff';
        data[keys.length-1].area =true;
        return data;
    }
